import React from 'react'
import { View, Text, Image, ImageBackground, StyleSheet, SafeAreaView } from 'react-native';
import { Fontisto as Icon } from '@expo/vector-icons'

const Home = () => {
    return (
        <SafeAreaView style={Styles.container}>
            <View style={Styles.top}>
                <View>
                    <Text style={Styles.subtitle}>Boleto Digital</Text>
                    <Text style={Styles.title}>PRATICIDADE NA DISTÃ‚NCIA DE UM TOQUE</Text>
                </View>
                <View>
                    <Icon name="whatsapp" color="#fff" size={24}/>
                    <Text style={Styles.subtitle}>9 9249-2222</Text>
                </View>
            </View>
            <View>
                <Image
                    source={require('../../assets/logo.png')}
                    style={Styles.image}
                />
            </View>
        </SafeAreaView>
    )
}

export default Home;

const Styles = StyleSheet.create({
    top: {
        backgroundColor: '#26d40f',
        flexDirection: 'row',
        flexWrap: 'nowrap',
        justifyContent: 'center'
    },
    bottom: {
        backgroundColor: '#000'
    },
    container: {
        flex: 1,
        justifyContent: 'flex-start',
    },
    image: {
        width: 240,
        height: 340,
        resizeMode: 'contain',
        marginLeft: '38%',
        marginBottom: '20%'
    },
    subtitle: {
        fontSize: 24,
        fontWeight: '300',
        color: '#fff'
    },
    title: {
        fontSize: 32,
        fontWeight: 'bold',
        color: '#fcf800'
    }
})
